INSERT INTO `page_page` VALUES (1,'About','about','<div class=\"story-container\">\r\n<p>&nbsp;</p>\r\n<p><strong>About TripleChoice</strong></p>\r\n<p>Welcome to TripleChoice, your trusted partner in technical part procurement!</p>\r\n<p><strong>Our Story</strong></p>\r\n<p>TripleChoice was founded by a dynamic team of experienced engineers, proficient programmers, and dedicated sales professionals. With a combined wealth of knowledge in engineering, technical parts procurement, supply chain management, e-commerce, and customer service, we embarked on a mission to revolutionize the way businesses source and acquire critical technical components.</p>\r\n<p><strong>Our Mission</strong></p>\r\n<p>At TripleChoice, our mission is simple yet powerful: to make technical part procurement easy, simple, and optimized based on your specific needs. We understand the challenges you face when seeking the right components to keep your operations running smoothly. That\'s why we\'ve made it our purpose to streamline this process, so you can focus on what you do best.</p>\r\n<p><strong>Why Choose TripleChoice?</strong></p>\r\n<p>We\'re not just another procurement platform; we\'re your dedicated partners. Our commitment to excellence, coupled with our in-depth understanding of your industry\'s unique needs, sets us apart. Here\'s why you should choose TripleChoice:</p>\r\n<ul>\r\n<li><strong>Expertise:</strong> Our team comprises seasoned professionals who have walked in your shoes. We understand the technical intricacies and the urgency behind your procurement requirements.</li>\r\n<li><strong>Solutions-Oriented:</strong> We take the time to understand your specific needs and tailor our services to match. Your success is our priority.</li>\r\n<li><strong>Efficiency:</strong> We leverage cutting-edge technology to optimize the procurement process, ensuring you get what you need when you need it.</li>\r\n<li><strong>Customer-Centric:</strong> Our customer service is unparalleled. We\'re always here to assist you and address any questions or concerns promptly.</li>\r\n</ul>\r\n<p><strong>Let Us Serve You</strong></p>\r\n<p>We invite you to explore all the options with us. Whether you\'re a small business or a large enterprise, TripleChoice is here to simplify your technical part procurement journey. Together, we\'ll drive efficiency, reduce downtime, and enhance your operations.</p>\r\n<p>Ready to experience the TripleChoice difference? Contact us today to discover how we can be your trusted partner in procurement.</p>\r\n</div>'),(2,'Contact','contact','<div class=\"story-container\">\r\n<div class=\"need-for-dx-container\">\r\n<p>&nbsp;</p>\r\n<p><strong>Contact</strong></p>\r\n<p>Ashley Dunphy, Sales Engineer</p>\r\n<p>Phone: (650) 620-0190</p>\r\n<p>Email: <a href=\"mailto:ashley@triplechoice.com\">ashley@triplechoice.com</a></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Get in Touch</strong></p>\r\n<p>For any inquiries or assistance, please don\'t hesitate to reach out to Ashley Dunphy, our Sales Engineer. She\'s here to help you with your technical part procurement needs.</p>\r\n</div>\r\n<div class=\"container-divider\">&nbsp;</div>\r\n</div>');
/*!40000 ALTER TABLE `page_page` ENABLE KEYS */;
UNLOCK TABLES;

